import React from "react";

const Country = ({name, capital, population, imgURL}) => {
  return(
    <div>
      <h1>{name.name.common}</h1>
      <p>{capital.capital}</p>
      <p>{population.population}</p>
      <label><b>Languages</b></label>
      <img alt="country flag" src={imgURL}/>
    </div>
  )
}

export default Country
